import React from 'react'
import { Button } from './Shared/Button'
import { Input } from './Shared/input'

const MovieForm = (props) => {
   const { onChange, onSubmit } = props
   const { Title, Genre, revenue, budget, Overview, production_companies, image_url, date } = props.formData
   return (
      <form className='form' onSubmit={(e) => onSubmit(e)}>
         <Input
            name='name'
            value={Title}
            required={true}
            placeholder='Movie Name'
            onChange={(e) => onChange(e)}
         />
         <Input
            name='genre'
            value={Genre}
            required={true}
            placeholder='Movie Genre'
            onChange={(e) => onChange(e)}
         />
         <Input
            name='revenue'
            value={revenue}
            required={true}
            placeholder='Movie Revenue'
            onChange={(e) => onChange(e)}
         />
         <Input
            name='budget'
            value={budget}
            required={true}
            placeholder='Movie Budget'
            onChange={(e) => onChange(e)}
         />
         <Input
            name='description'
            value={Overview}
            required={true}
            placeholder='Movie Overiew'
            onChange={(e) => onChange(e)}
         />
         <Input
            name='Production Companies'
            value={production_companies}
            required={true}
            placeholder='Movie Production Companies'
            onChange={(e) => onChange(e)}
         />
         <Input
            name='image_url'
            value={image_url}
            required={false}
            placeholder='Movie Image'
            onChange={(e) => onChange(e)}
         />
         <Input
            placeholder='Release Date'
            name='Release Date'
            value={release_Date}
            required={true}

            onChange={(e) => onChange(e)}
         />
         <Button title='Submit Info' />
      </form>

   )

}


export default MovieForm
